import {FiUser} from 'react-icons/fi'
import Title from '../../components/Title'
import Header from '../../components/Header'





export default function Customers() {
    return (
        <div>
            <Header/>

            <div className='content'>
                <Title name='Clientes'>
                    <FiUser/>
                </Title>
            </div>
        </div>
    );
}
